import React, { useState, useEffect } from 'react';
import { BroswerRouter as Router,Route ,Switch} from 'react-dom';
import Home from './home';
import Detail from './detail';


function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("https://www.instagram.com/lacorgi/?__a=1&max_id=endcursor")
    .then(response => response.json())
    .then(data => setData(data));
  }, [])

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path={`${process.env.PUBLIC_URL}/`}>
            <Home/>
          </Route>
          <Route exact path={`${process.env.PUBLIC_URL}/home`}>
            <Home />
          </Route>
          <Route path={`${process.env.PUBLIC_URL}/detail/:slug`}>
            <Detail />
          </Route>
          <Route path="*">404</Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
